let countDownDate = new Date("Jan 5, 2021 15:37:25").getTime();

//2. Buat fungsi untuk menghitung waktu
function countDown() {
  // Dapatkan tanggal dan waktu saat ini
  let now = new Date().getTime();

  // Temukan jarak antara sekarang dan tanggal yang ditentukan
  let distance = countDownDate - now;

  // Hitung jumlah hari, jam, menit, dan detik
  let days = Math.floor(distance / (1000 * 60 * 60 * 24));
  let hours = Math.floor((distance % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
  let minutes = Math.floor((distance % (1000 * 60 * 60)) / (1000 * 60));
  let seconds = Math.floor((distance % (1000 * 60)) / 1000);

  // Tampilkan hasilnya
  document.getElementById(""countdown"").innerHTML = days + "d " + hours + "h "
  + minutes + "m " + seconds + "s ";

  // Jika waktu habis, tulis pesan
  if (distance < 0) {
    clearInterval(countdownInterval);
    document.getElementById("countdown").innerHTML = ""Waktu habis!"";
  }
}

//3. Panggil fungsi countDown setiap 1 detik
let countdownInterval = setInterval(countDown, 1000);

